import React from "react";
import { useNavigate } from "react-router-dom";

export default function UserPanel({ user, onClose }) {
  const navigate = useNavigate();
  const userId = user?.userId || user?._id;

  const handleLogout = () => {
    // Clear session data
    localStorage.removeItem("user");
    localStorage.removeItem("token"); // optional: if you're using auth tokens
    sessionStorage.clear(); // optional: clear temporary state

    // Sync logout across tabs
    window.dispatchEvent(new Event("storage"));

    // Redirect to login
    navigate("/login");
  };

  if (!userId) {
    return (
      <div
        className="card shadow-sm p-4 text-center"
        style={{
          position: "absolute",
          top: "70px",
          right: "20px",
          width: "320px",
          zIndex: 1000,
          borderRadius: "12px",
          backgroundColor: "#fff",
        }}
        tabIndex={0}
      >
        <h5 className="text-danger mb-3">‚ö†Ô∏è User not found</h5>
        <p className="text-muted">Please log in to view account details.</p>
        <button
          className="btn btn-outline-primary w-100"
          onClick={() => navigate("/login")}
          aria-label="Login"
        >
          üîì Login
        </button>
      </div>
    );
  }

  return (
    <div
      className="card shadow-sm p-4"
      style={{
        position: "absolute",
        top: "70px",
        right: "20px",
        width: "320px",
        zIndex: 1000,
        borderRadius: "12px",
        backgroundColor: "#fff",
      }}
      tabIndex={0}
    >
      {/* Header */}
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h5 className="text-primary mb-0">üë§ Account</h5>
        <button
          className="btn btn-sm btn-outline-secondary"
          onClick={onClose}
          aria-label="Close panel"
        >
          ‚úñ
        </button>
      </div>

      {/* User Info */}
      <div className="mb-3">
        <p className="mb-1"><strong>Name:</strong> {user?.name || "Guest"}</p>
        <p className="mb-1"><strong>Email:</strong> {user?.email || "Not available"}</p>
        <p className="mb-0"><strong>Role:</strong> {user?.role || "User"}</p>
      </div>

      <hr />

      {/* Navigation Buttons */}
      <div className="d-grid gap-2 mb-3">
        <button className="btn btn-outline-primary" onClick={() => navigate("/profile")}>
          üë§ My Profile
        </button>
        <button className="btn btn-outline-secondary" onClick={() => navigate("/orders")}>
          üì¶ Orders
        </button>
        <button className="btn btn-outline-success" onClick={() => navigate("/prescriptions")}>
          üßæ Prescription Status
        </button>
      </div>

      <hr />

      {/* Logout */}
      <button
        className="btn btn-outline-danger w-100"
        onClick={handleLogout}
        aria-label="Logout"
      >
        üîì Logout
      </button>

      {/* App Promo */}
      <div className="mt-4 text-center text-muted" style={{ fontSize: "14px" }}>
        üì± Download our mobile app<br />
        <a
          href="/app"
          className="text-decoration-none"
          target="_blank"
          rel="noopener noreferrer"
        >
          Take MediQ with you
        </a>
      </div>
    </div>
  );
}
